import Button from "./Button";

type CategoryMenuProps = {
  categories: string[];
};
export function CategoryMenu({ categories }: CategoryMenuProps) {
  return (
    <div>
      {categories.map(category)}
      <Button>Catalog</Button>
    </div>
  );
}
